function delay(time) {
  return new Promise(resolve => setTimeout(resolve, time));
}

async function obtemClasse(connection, idAviso) {

  var result = await connection.execute(
    `
      SELECT
      avc.AVCI_DK ,
        CLAS.TJCL_DS_CLASSE classe_nm_simples,
        (
            select    REVERSE( SYS_CONNECT_BY_PATH( REVERSE( CLA2.TJCL_DS_CLASSE ) , ' * ') )
            from  tjrj.tjrj_classe cla2
            where  CONNECT_BY_ISLEAF = 1
            start with CLA2.TJCL_CD_CLASSE = CLAS.TJCL_CD_CLASSE
            connect by prior  CLA2.TJCL_CD_CLASSE_PAI = CLA2.TJCL_CD_CLASSE
        ) classe_nm_completo_tjrj
    from TJRJ_AVISO_COMUNIC_INTIMACAO avc 
    left JOIN tjrj.tjrj_classe CLAS ON CLAS.TJCL_CD_CLASSE = AVC.AVCI_CD_CLASSE_TJ
    left  join mcpr.mcpr_classe_docto_mp dmp 
      on DMP.CLDC_CD_CLASSE = CLAS.TJCL_CD_CLASSE and DMP.CLDC_IN_ATIVO = 'S'
      and CLAS.TJCL_CD_CLASSE > 0
    where 1=1
    AND avc.AVCI_DK = :idAviso
 `,
     { idAviso: idAviso },  
     {
        resultSet: true,
        outFormat: oracledb.OUT_FORMAT_OBJECT
      }
  );

  return result;
}

